INSERT INTO `wa_pages` (`id_page`, `titre`, `description_meta`, `contenu`, `date_modif`, `statut`, `geo_long`, `geo_lat`) VALUES
(1, 'À propos', 'À propos ', '<h2>Une entreprise canadienne, basée au Québec</h2>\r\n<p>Entreprise canadienne établie au Québec depuis plus de 40 ans, SAIL dirige ses opérations à partir de son siège social, situé à Laval. SAIL possède présentement des succursales à Beloeil, à Brossard, à Burlington, à Etobicoke, à Laval, à Oshawa, à Ottawa, à Québec et à Vaughan. Bien qu''elle offre déjà le plus grand réseau de magasins de plein air, de camping, de chasse et pêche de l’E4 st du Canada,  SAIL prévoit poursuivre son développement en ouvrant de nouvelles succursales au Québec et en Ontario au cours des prochaines années.</p>\r\n<p>SAIL, «  la plus grande destination plein air », a pour mission d’offrir le plus grand choix de produits des meilleures marques à des prix plus que compétitifs. Dans cette optique, outre son choix exceptionnel de vêtements de plein air, chaque magasin est une véritable salle d’exposition en mettant à disposition entre 20 et 50 modèles de tentes entièrement montées (variable selon la saison), 40 modèles d’embarcations (kayaks et canots principalement), 3500 paires de  raquettes à neige, 1550 modèles de cannes à pêche, 500 modèles de bottes et de chaussures de plein air et bien d’autres produits indispensables pour pratiquer vos loisirs en étant bien équipé et confortable. En tout, c''est plus de 500 000 articles dans chacun des magasins SAIL!</p>\r\n\r\n<h3>Des employés qui savent de quoi ils parlent</h3>\r\n<p>Chaque succursale compte plus de 100 employés et SAIL investit de façon importante dans la formation de son personnel. Parmi ces employés, on retrouve des professionnels de chasse et de pêche, des guides d’expédition, des spécialistes de kayak et de marche nordique, des adeptes de course et de raids de haut niveau.  Ainsi, dans l’un ou l’autre des départements,  le consommateur peut compter à coup sûr sur l’expertise d’un spécialiste ou d’un passionné de plein air et bénéficier de ses conseils.</p>', '2014-01-12 17:50:20', 1, NULL, NULL),
